import React from 'react';
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";

function Sidebar() {
    return <div className="sidebar">
        <SidebarRow src={user.photoUrl}  
        title={user.displayName} 
        />
        <SidebarRow Icon = {EmojiFlagsIcon}
          title="Pages"
        />   

    </div>
}

export default Sidebar
